import React, { Component } from "react";
import "./estilos.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class Cabecalho extends Component{
    render(){
        return(
            <h1 className="cabecalho">Teste</h1>
        )
    }
}

export default Cabecalho;
